var Ac4yLifecycleConstant=require("../constant/Ac4yLifecycleConstant.js"); 

var Ac4yLifecycleFact=require("./Ac4yLifecycleFact.js");

class Ac4yLCFStation extends Ac4yLifecycleFact {
    
    constructor(object){
        
        super(object);
        if (object != undefined && object === 0) return;
        
        this.setDimension(new Ac4yLifecycleConstant().DIMENSION.station);

    } // constructor
    
    createSelf(object) {return new Ac4yLCFStation(object);}
    
} // Ac4yLCFStation

module.exports=Ac4yLCFStation
